var intToCharMap="ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/".split("");exports.encode=function(a){if(0<=a&&a<intToCharMap.length){return intToCharMap[a]}throw new TypeError("Must be between 0 and 63: "+a)};exports.decode=function(j){var g=65;var e=90;var a=97;var k=122;var h=48;var d=57;var f=43;var c=47;var i=26;var b=52;if(g<=j&&j<=e){return(j-g)}if(a<=j&&j<=k){return(j-a+i)}if(h<=j&&j<=d){return(j-h+b)}if(j==f){return 62}if(j==c){return 63}return -1};